import React from 'react';
import Auth from './components/Auth'
import { LoggedIn } from './components/LoggedIn'

const App = (LoggedIn: any) => {
  return (
    <div className="App">
      <Auth {...LoggedIn} />
    </div>
  );
}


export default App;
